        protected override void RunSearch()
        {
            string sql = @"
                  select Klient = PRS.Name + isNull(' ' + PRS.Vorname,''),
                         LE = MOD.Text,
                         MA = USR.LastName + isNull(' ' + USR.Firstname,''),
                         FAL.*
                  from   FaFall FAL
                         inner join BaPerson PRS on PRS.BaPersonID = FAL.BaPersonID
                         inner join XUSer     USR on USR.UserID = FAL.UserID
                         inner join XLOVCode  MOD on MOD.LOVName = 'Modul' and
                                              MOD.Code = FAL.ModulCode
                  where FAL.DatumBis is null";

            //LE
            if (!DBUtil.IsEmpty(this.edtLE.EditValue))
                sql += " AND FAL.ModulCode = " + DBUtil.SqlLiteral(this.edtLE.EditValue);

            // Mitarbeiter
            if (edtSearchMA.Text != "")
                sql += " AND FAL.UserID = " + DBUtil.SqlLiteral(edtSearchMA.LookupID);

            // Klient
            if (edtSearchClient.Text != "")
                sql += " AND FAL.BaPersonID = " + DBUtil.SqlLiteral(edtSearchClient.LookupID);

            qryFall.Fill(sql);
            //	tabControlSearch.SelectedTabIndex = 0;
            grdKlient.Focus();
            Cursor.Current = Cursors.Default;
        }

