        private string GetScanFilesPath(string username)
        {
            string basePath = Convert.ToString(DBUtil.GetConfigValue(@"System\Dokumentemanagement\Transferpfad", ""));
            if (basePath != null && username != null)
            {
                return System.IO.Path.Combine(basePath, username);
            }
            else
            {
                return null;
            }
        }

