            FROM FaUnterlagen UNT
            WHERE FaFallID = {0}", qryFall["FaFallID"]);
        }

        private void RefreshDocList()
        {
            qryDoc.DataTable.Clear();
            string scanFilesPath = this.GetScanFilesPath(edtMA.LookupID as string);

            if (edtMA.EditValue == null)
            {
                qryDoc.Fill(@"
            SELECT FileName = DocumentID, Modified = DateLastSave
            FROM XDocument
            WHERE Typ = {0}
                ", edtTopfAuswahl.EditValue);
            }
            else if (scanFilesPath != string.Empty && System.IO.Directory.Exists(scanFilesPath))
            {
                foreach (string filename in System.IO.Directory.GetFiles(scanFilesPath))
                {
                    System.IO.FileInfo info = new System.IO.FileInfo(filename);
                    qryDoc.DataTable.Rows.Add(info.Name, info.LastWriteTime);
                    qryDoc.DataTable.AcceptChanges();
                    qryDoc.RowModified = false;
                }
            }
            qryDoc.DataTable.AcceptChanges();
            qryDoc.RowModified = false;
        }

